@iamJHud is paying it forward to fellow Black women business owners as part of MasterCard's Strivers Initiative. Hudson is gearing up to reopen the famed Apollo on August 18th as the first performer to hit the legendary stage since last year. Ahead of the premiere of the Aretha Franklin biopic "Respect", Hudson talks performing some of her biggest hits and paying tribute to the Queen of Soul at a theater that's a staple in Black culture with @jeroslyndiva.

@iamBeaDixon used her gift for healing and an intuitive approach to business to build feminine care company @thehoneypotco into a multimillion-dollar brand.⁠⁠
